import React from 'react';
import data from '../data/logement.json';
import Card from '../components/Card';
import '../sass/pages/home.scss';

function Home() {
    return (
        <div className='home'>
            <div className="home-container">
                {data.map((logement) => (
                    <Card
                        key={logement.id}
                        title={logement.title}
                        cover={logement.cover}
                    />
                ))}
            </div>
        </div>
    );
}

export default Home;
